const Contact = () => {
  return (
    <section className="bg-transparent mb-12">
      <div
        className="mt-[-60px] mx-5 mb-12 rounded-lg bg-gradient-to-r from-slate-900 to-slate-700"
      >
          <div className="flex h-[30vh] justify-center rounded-lg items-center">
            <p className="text-5xl md:text-6xl text-center text-white tracking-widest mt-[80px] anton pb-2">
              Contact Us
            </p>
          </div>
      </div>
      <div className="container mx-auto px-5 md:px-12">

        <div>
          <p className="text-center text-md text-gray-900 anton">Do you have a question, comment, concern, suggestion or news tip to pass along to Complex? Send us a message. </p>
        </div>

        </div>
    </section>
  );
};

export default Contact;
